    null,nt"notes": "This data set contains the outlines for active federal oil
    and gas leases in the Alaska OCS Region through sale 193. They represent a close
    approximation, but might not be the exact coordinates for those leases. For the
    official coordinates please refer to the OPD or SOBD for the lease. ALSO NOTE: older
    leases were done on a NAD 27 grid, and their lease coordinates will not change as
    long as the lease remains active. Although the NAD 27 leases have been projected
    to NAD 83 for inclusion in this file, when plotted on the current NAD 83 leasing
    grid, they will not appear to "line up", because the NAD 83 grids represents a
    complete re-grid and not a re-projection of the old NAD 27 grid. All current leasing,
    starting with Sale 144 in September 1996 has been done on the NAD 83 grid.",nt"license_title":
